import Header from '../Header'
import { memo } from 'react'
import { StickyContainer, Sticky } from 'react-sticky';
import './HeaderOnly.scss'

function HeaderOnly({ languageSelected, setLanguageSelected, children, setProgress }) {
    return (
        <StickyContainer>
            <div className='layout-header-only'>
                <Sticky>
                    {({ style }) => (
                        <Header style={style} setLanguageSelected={setLanguageSelected} languageSelected={languageSelected} setProgress={setProgress} />
                    )}
                    {children}
                </Sticky>
            </div>
        </StickyContainer>
    )
}

export default memo(HeaderOnly)
